import React from "react";
import JobListing from "./ListingUtils/JobListing";
import ListingHeader from "./ListingUtils/ListingHeader";

const Listings = () => {
  const data = [
    {
      title: "job1",
      description: "this is a description for job 1",
      tags: ["Java", "CSS"],
      expiry: "10 days left",
      price: "123",
      count: "9",
    },
    {
      title: "job1",
      description: "this is a description for job 2",
      tags: ["Java", "CSS", "idk"],
      expiry: "6 days left",
      price: "1000",
      count: "20",
    },
  ];
  return (
    <div className="col-12 col-md-8 containerp-3 bg-white shadow">
      <div className="row">
        <ListingHeader />
      </div>
        {data.map((element) => {
          return <div className="row"><JobListing element={element}  /></div>;
        })}
      
    </div>
  );
};

export default Listings;
